div.script:
$('.tr2.tac').find('td').each(function(){
	$(this).css('cursor', 'pointer');
	$(this).attr('title', '以“'+$(this).text()+'”顺序排列')
})
$('.tr2.tac').find('td').click(function(){
    var table = $('#tbody')
    var rows = table.find('tr').toArray().sort(comparer($(this).index()))
    this.asc = !this.asc
    if (this.asc){rows = rows.reverse()}
    for (var i = 0; i < rows.length; i++){table.append(rows[i])}
})
function comparer(index) {
    return function(a, b) {
        var re = /[0-9\. ]+(GB|MB|G|M)/i, valA = getCellValue(a, index).replace(re, ''), valB = getCellValue(b, index).replace(re, '')
        return $.isNumeric(valA) && $.isNumeric(valB) ? valA - valB : valA.toString().localeCompare(valB)
    }
}
function getCellValue(row, index){
	var f = ( $('.tr2.tac').find('td').eq(2).text()=='板块' && index==1 ) ? $(row).children('td').eq(2).text().trim().split('\n')[0] : '';
	return f + $(row).children('td').eq(index).text();
}
